import { View, Text } from "react-native";
import React from "react";
import { ListItem } from "react-native-elements";

import styled from 'styled-components/native'

const dummyData = [
  {
    id: 1,
    hoh: "Tommy Shelby",
    beds: 3,
  },
  {
    id: 2,
    hoh: "Tommy Shelby",
    beds: 3,
  },
  {
    id: 3,
    hoh: "Tommy Shelby",
    beds: 3,
  },
  {
    id: 4,
    hoh: "Tommy Shelby",
    beds: 3,
  },
  {
    id: 5,
    hoh: "Tommy Shelby",
    beds: 3,
  },
  {
    id: 6,
    hoh: "Tommy Shelby",
    beds: 3,
  },
];

const Index = () => {
  return (
    <View>
      {dummyData.map((l, i) => (
        <ListItem
          key={i}
          leftAvatar={{ source: { uri: l.avatar_url } }}
          title={l.hoh}
          subtitle={l.beds}
          bottomDivider
          chevron
        />
      ))}
    </View>
  );
};


const Container = styled.View`


`

export default Index;
